import React from 'react';
import Star from './starWars/Star';
import AlignItemsList from "./starWars/List"
const styles = {
    paperContainer: {
        height: '100%',
        width: '100%',
        backgroundImage: `url(${"https://64.media.tumblr.com/d96d6d4360f27da5c47221e68cdff36f/tumblr_olucp2SNGx1vsjcxvo1_r1_640.gifv"})`,
        backgroundRepeat  : 'no-repeat',
    }
};
function App() {
  return (
    <div style={styles.paperContainer} className="App">
      <h1 >Star Wars</h1>

      <Star/>
   <AlignItemsList/>


    </div>
  );
}

export default App;
